import logo from './logo.svg';
import './App.css';
import React from 'react';
import { Visor } from './Visor';
import { Botones } from './Botones';
import { Calculadora } from './Calculadora';
<img src={logo} className="App-logo" alt="logo" />

function App() {
  return (
    <React.Fragment>
      <Calculadora>
        <Visor />
        <Botones>

        </Botones>
      </Calculadora>
    </React.Fragment>
  );
}

export default App;
